import React from "react";
import { mockUsers } from './mockUsers';
import { mockBets } from './mockData';

const user = {
  ...mockUsers[0],
  email: "valar.morghulis.got21@itbhu.ac.in",
  enrollment: "21075001",
  tokens: 103810,
  streak: 6,
  successRate: 90,
};

const stats = [
  {
    label: 'Total Bets',
    value: 5,
    icon: (
      <svg width="24" height="24" fill="none" stroke="#28c76f" strokeWidth="2.2" viewBox="0 0 24 24"><circle cx="12" cy="12" r="10" /><circle cx="12" cy="12" r="3" /></svg>
    )
  },
  {
    label: 'No. of Active Bets',
    value: 2,
    icon: (
      <svg width="24" height="24" fill="none" stroke="#28c76f" strokeWidth="2.2" viewBox="0 0 24 24"><path d="M12 8v4l3 3" /><circle cx="12" cy="12" r="10" /></svg>
    )
  },
  {
    label: 'Streak',
    value: user.streak,
    icon: (
      <svg width="24" height="24" fill="none" stroke="#28c76f" strokeWidth="2.2" viewBox="0 0 24 24"><polyline points="3 17 9 11 13 15 21 7" /></svg>
    )
  },
  {
    label: 'Success',
    value: `${user.successRate.toFixed(2)}%`,
    icon: (
      <svg width="24" height="24" fill="none" stroke="#28c76f" strokeWidth="2.2" viewBox="0 0 24 24"><path d="M12 2l3 7h7l-5.5 4.5L17 21l-5-3.5L7 21l1.5-7.5L3 9h7z" /></svg>
    )
  },
];

export default function Profile() {
  return (
    <div className="min-h-screen bg-[#181f1f] py-8 px-2 flex flex-col items-center">
      <div className="w-full max-w-4xl mx-auto">
        {/* Profile Card with green accent */}
        <div className="relative rounded-2xl bg-[#181f1f] border border-[#28c76f] mb-8 overflow-hidden shadow-lg">
          {/* Green diagonal accent */}
          <div className="absolute top-0 right-0 w-2/3 h-32 bg-gradient-to-tr from-[#28c76f] to-[#181f1f]" style={{clipPath:'polygon(100% 0, 0 100%, 100% 100%)'}}></div>
          <div className="relative z-10 flex flex-col md:flex-row items-center md:items-start gap-8 p-8">
            <div className="flex-shrink-0 flex items-center justify-center w-28 h-28 rounded-full bg-[#28c76f] text-4xl font-bold">
              {user.name.split(' ').map(n => n[0]).join('').toUpperCase()}
            </div>
            <div className="flex-1 flex flex-col justify-center">
              <div className="text-3xl font-bold text-[#28c76f] mb-2">{user.name}</div>
              <div className="text-lg text-gray-200 mb-1">{user.email}</div>
              <div className="text-lg text-gray-200 mb-1">Enrollment No: <span className="font-bold text-white">{user.enrollment}</span></div>
              <div className="text-gray-400 text-base mb-2">{user.tokens.toLocaleString()} Tokens</div>
              <div className="text-base text-gray-300 mb-1">Success Rate</div>
              <div className="w-full h-4 bg-[#232b3a] rounded-full overflow-hidden relative">
                <div className="h-full bg-[#28c76f]" style={{width: `${user.successRate}%`}}></div>
                <span className="absolute right-2 top-1/2 -translate-y-1/2 text-xs font-bold text-[#28c76f]">{user.successRate.toFixed(2)}%</span>
              </div>
            </div>
          </div>
        </div>
        {/* Stats Cards */}
        <div className="grid grid-cols-1 md:grid-cols-4 gap-6 mb-8">
          {stats.map((stat, idx) => (
            <div key={idx} className="rounded-2xl border border-[#28c76f] p-6 flex flex-col items-center bg-[#181f1f]">
              <span className="mb-2">{stat.icon}</span>
              <span className="text-lg text-[#28c76f] mb-1">{stat.label}</span>
              <span className="text-2xl font-bold">{stat.value}</span>
            </div>
          ))}
        </div>
      </div>
    </div>
  );
}
